import "./Aplication.css";
import arrow from "../assets/img/Vector.png";
function AplicationList() {
  return (
    <div className="heading">
      <p className="numbers">1</p>
      <div className="img_div">
        <img src={arrow} alt="" />
      </div>
    </div>
  );
}
export default AplicationList;
